import React from "react";
// import "./MehreenStyles.css"
import ReactBootstrap, {Nav, Button, Navbar,NavDropdown,Form,FormControl} from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import Scrollchor from 'react-scrollchor';
import firebase from './fire';

function LoginLinks(){
    return(
        <div class >
        <Nav className="mr-auto">  {/* for the left side of navbar*/}
  
              <li class="nav-item active">
              <Scrollchor  class="nav-link" to="to-menu" style={{background: "#955F61",color: "white"}}>Menu</Scrollchor >
            </li>
            <li class="nav-item">
              <Scrollchor  class="nav-link" to="to-services" style={{background: "#955F61",color: "white"}}>Services</Scrollchor >
            </li>
            <li class="nav-item">
              <Scrollchor  class="nav-link" to="to-about" style={{background: "#955F61",color: "white"}}>About Us</Scrollchor >
            </li>
              </Nav>
             <Nav className="ml-auto">  {/* for the right side of navbar*/}
              <li class="nav-item active">
              <Scrollchor  class="nav-link" to="to-deals" style={{background: "#955F61",color: "white",marginTop:"10px"}}>Deals</Scrollchor >
            </li>
            <li class="nav-item active">
              <a  class="nav-link" href="/loginpage" style={{background: "#955F61",color: "white",marginTop:"10px"}}>HELLO</a >
            </li>
            <li class = "nav-item">
              <button class="btn" onClick={logout} style={{background: "#955F61",color: "white",marginTop: "11px"}}>Log Out</button>
            </li>
            <li class = "nav-item">
              <button class="btn"><i class="fa fa-search" style={{background: "#955F61",color: "white",marginTop: "11px"}}></i></button>
            </li>
            <li class="nav-item">
              <a type = "button" id = "GFG" href="https://www.facebook.com/uzmascuisine/" class="fa fa-facebook" style={{background: "#955F61",color: "white",marginTop: "18px"}}></a >
            </li>
            <li class="nav-item">
              <a type = "button" id = "GFG"  href="https://www.instagram.com/bonappetempt.pk/" class="fa fa-instagram" style={{background: "#955F61",color: "white",marginTop: "18px"}}></a >
            </li>
    
            </Nav>
            </div>
            
    );

    async function logout() {
		await firebase.logout()
		props.history.push('/')
	}
}

export default withRouter(LoginLinks);
